        #region 正则表达式
        /// <summary>
        /// 传感器信息的正则表达式
        /// </summary>
        public static string Pattern_SensorMessage = @"0[1-8]\s00\s00\s0[0-7]\s[0-7][0-9a-fA-F](\s[0-9a-fA-F]{2}){8}";

        /// <summary>
        /// 集群列表(600,cluster list status)，目标列表(60A,object list status)消息的正则表达式
        /// </summary>
        public static string Pattern_ClusterObjectStatus = @"0[1-8]\s00\s00\s06\s[0-7][0aA](\s[0-9a-fA-F]{2}){8}";

        /// <summary>
        /// 除集群列表(600,cluster list status)，目标列表(60A,object list status)之外所有消息的正则表达式
        /// </summary>
        public static string Pattern_NotClusterObjectStatus = @"0[1-8]\s00\s00\s(0[0-57]\s[0-7][0-9a-fA-F]|06\s[0-7][1-9b-fB-F])(\s[0-9a-fA-F]{2}){8}";

        /// <summary>
        /// 被集群列表(600,cluster list status)，目标列表(60A,object list status)包裹住的消息集合的正则表达式（被包裹消息的帧ID非600或60A，消息之间可存在任意空白符）
        /// </summary>
        public static string Pattern_WrappedStatus = @"0[1-8]\s00\s00\s06\s[0-7][0aA](\s[0-9a-fA-F]{2}){8}(\s)*(0[1-8]\s00\s00\s(0[0-57]\s[0-7][0-9a-fA-F]|06\s[0-7][1-9b-fB-F])(\s[0-9a-fA-F]{2}){8}(\s)*)+0[1-8]\s00\s00\s06\s[0-7][0aA](\s[0-9a-fA-F]{2}){8}";

        /// <summary>
        /// 正则处理类，模式为被集群列表(600,cluster list status)，目标列表(60A,object list status)包裹住的消息集合的正则表达式（被包裹消息的帧ID非600或60A，消息之间可存在任意空白符）
        /// </summary>
        public static Regex RegWrapped = new Regex(Pattern_WrappedStatus, RegexOptions.Compiled);
        #endregion

